import React from "react";
import HeaderLink from "./HeaderLink";
import style from "./HeaderBody.module.css";

function HeaderBody() {
  return (
    <div className={style.list}>
      <HeaderLink name="Normal"className={style.li}  />
      <HeaderLink name="Good" className={style.li} />
      <HeaderLink name="Busy" className={style.li} />
      <HeaderLink name="Hot" className={style.li} />
      <HeaderLink name="Upkeep" className={style.li} />
    </div>
  );
}

export default HeaderBody;
